import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import necessary router components
import MainGrid from './components/MainGrid';  // Import your components as needed
import Home from './components/Home';
import Navbar from './components/Navbar'; // Assuming Navbar is in the components folder
import Cart from './components/Cart';    // Example of another route, adjust as necessary
import Products from './components/Products'; // Adjust according to your setup

function App() {
  return (
    <Router>  {/* Wrap the app in the Router component */}
      <div className="App">
        <Navbar />  {/* Navbar will now be within the Router context */}
        <Switch>   {/* Switch ensures only one route is rendered at a time */}
          <Route exact path="/" component={Home} />   {/* Home route */}
          <Route path="/cart" component={Cart} />     {/* Cart route */}
          <Route path="/products" component={Products} />  {/* Products route */}
          {/* Add more routes as needed */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
